Uncaught Error: After filtering out keys not in the schema, your modifier is now empty<p>everyone. I am working on an attendance system using meteor.js. So I have two collections <code>subject</code> , <code>student</code>. In this system, a form will be submitted with selected studentID and subjectCode for subject enrollment. However, I got this error when I submitted. <code>Uncaught Error: After filtering out keys not in the schema, your modifier is now empty.</code> </p>

<p>The subject schema is like this</p>

<pre><code>const subjectSchema = new SimpleSchema({
subjectCode:{
type: String,
label: “Subject Code”,
index:true,
unique:true
},
subjectName:{
type: String,
label: “Subject Name”,
index:true,
unique:true
},
enrollment:{
type: Array,
optional: true
},
‘enrollment.$’:String,
});
</code></pre>

<p>For actions</p>

<pre><code>Template.enroll.events({
  'submit form':function(e){
    e.preventDefault();
    var name = $(e.target).find('[name=studentID]').val();
    var subjectCode = $(e.target).find('[name=subjectCode]').val();

    subject.update(
      {subjectCode:subjectCode},
      {$push:{"enrollment.$":name}});
  }
});
</code></pre>

<p>If anyone could help me out here I would really appreciate it.
Thanks a lot.</p>

