MongoDB - Find document by _id and return without child elements by value<p>I'm working on a project where I'm trying to return a document, but exclude some child fields based on status. For example if the status is disabled then I don't want that child returned. But all the other records returned if they don't contain disabled.</p>

<p>The request includes the <code>_id</code> of the document that I want to find and return, without the 'disabled' child records.</p>

<p>How do I select the document by <code>_id</code> then, exclude records from the child array based on a value.</p>

<p>Thanks</p>

<p>My document look like this:</p>

<pre><code>{
    "_id" : ObjectId("5e7bb266071f9601b6ad8f4e"),
    "name" : "Test Document",
    "postcode" : "90210",
    "colors" : [ 
        {
            "_id" : ObjectId("5e7d276a05674f0cf49bdcec"),
            "color" : "blue",
            "status": "active"

        }, 
        {
            "_id" : ObjectId("5e7d276a05674f0cf49bdceg"),
            "color" : "red",
            "status": "active"
        }, 
        {
            "_id" : ObjectId("5e7d276a05674f0cf49bdceh"),
            "color" : "green",
            "status" : "disabled"
        }
    ]
}
</code></pre>

<p>How do I return:</p>

<pre><code>{
    "_id" : ObjectId("5e7bb266071f9601b6ad8f4e"),
    "name" : "Test Document",
    "postcode" : "90210",
    "colors" : [ 
        {
            "_id" : ObjectId("5e7d276a05674f0cf49bdcec"),
            "color" : "blue",
            "status": "active"

        }, 
        {
            "_id" : ObjectId("5e7d276a05674f0cf49bdceg"),
            "color" : "red",
            "status": "active"
        }
    ]
}
</code></pre>

<p>I have been trying variations of:</p>

<pre><code>    findr.aggregate([

        {
            $match: {
                $and: [{
                    _id: mongodb.ObjectId(_id)
                }, {
                    'color.status': 'active'
                }]
            }
        },
        {
            $project: {
                _id
                name: 1,
                postcode: 1,
                colors: {
                    $filter: {
                        input: '$colors',
                        as: 'color',
                        cond: {
                            $eq: ['$$color.status', 'active']
                        }
                    }
                }
            }
        }

    ])
</code></pre>

