.forEach() in EJS and Mongoosse<p>I'm trying to show every author stored in a mongo db in an ejs file. My idea was to iterate over every author using Model.find({})</p>

<p>authorController.js</p>

<pre class="lang-js prettyprint-override"><code>const express = require('express')
const router = express.Router()
const Author = require('../models/Author')


router.get('/', async (req, res) =&gt; {
    try{
        const authors = Author.find({})
        res.render('authors/index', {authors: authors})
    } catch(error) {
        res.redirect('/')
    }
})
</code></pre>

<p>index.ejs</p>

<pre class="lang-html prettyprint-override"><code>&lt;h1&gt;Search authors&lt;/h1&gt;

&lt;form action="/authors" method="GET"&gt;
    &lt;label&gt;Name&lt;/label&gt;
    &lt;input type="text" name="name"&gt;
    &lt;button type="submit"&gt;Search&lt;/button&gt;
&lt;/form&gt;

&lt;% authors.forEach(author =&gt; { %&gt;
    &lt;div class="author"&gt;&lt;%= author.name %&gt;&lt;/div&gt;
&lt;% }) %&gt;
</code></pre>

<p>The Author model</p>

<pre class="lang-js prettyprint-override"><code>const mongoose = require('../database')

const AuthorSchema = mongoose.Schema({
    name: {
        type: String,
        required: true,
    }
})

module.exports = mongoose.model('Author', AuthorSchema)
</code></pre>

<p>It raises the error: authors.forEach is not a function</p>

<p>I've read a bit and I think this is happening because I can´t iterate over an object using forEach(). How can I do it so?</p>

